import * as React from 'react';

interface IShiftListProps {
   data: any;
}

interface iShiftData {
   id: number;
   date: string;
   time: string;
}

const ShiftList: React.FunctionComponent<IShiftListProps> = ({ data }) => {
   console.log(data);
   return (
      <ul>
         {data.map((item: iShiftData) => (
            <li key={item.id}>
               {item.date} - {item.time}
            </li>
         ))}
      </ul>
   );
};

export default ShiftList;
